import Link from 'next/link';
import { Button, Alert } from 'react-bootstrap';

const Header = (props) => {
  // console.log(Button);
  const onClick = () => {
    alert('button Click');
  };
  return (
    <Fragment>
      <div id="header">
        <div className="container">
          <span>logo</span>
          <div>
            <Button onClick={onClick}>
              <i className="fa fa-search" aria-hidden="false" />
            </Button>
          </div>
          <div>
          <ul>
            <li>
              <Link href="/">
                <a>Index</a>
              </Link>
            </li>
            <li>
              <Link href="/login">
                <a>Login</a>
              </Link>
            </li>
          </ul>
          </div>
        </div>
      </div>
      <style jsx>
        {`
        `}
      </style>
    </Fragment>
  );
};

export default Header;
